import React from 'react';

function Box() {
    return(
        <div className='s-box'>
            <div className='s-b-img'>
                <img src="https://cdn.discordapp.com/attachments/784189691321778177/844103149450821642/20210518_094419.jpg" alt='osmanhakan'/>
            </div>
        </div>
    )
}

export default Box;
